const initialState = {
  user:1,
  insulins:[],
  selectedInsulin: 4
}

const reducer = (state = initialState, action) =>{
  switch (action.type){
    case("GET_INSULINS"):{
      return {...state, insulins:action.payload}
    }
    case("SELECT_INSULIN"):{
      return {...state, selectedInsulin: action.payload}
    }
    case("ADD_ENTRY"):{
      const insulin = state.insulins.find((insulin)=> insulin.id ===action.payload.insulin_id)
      // console.log(insulin)
      // const insulinEntriesCopy = [...insulin.all_associated_entries, action.payload]
      const insulinNewData = {...insulin, all_associated_entries: [...insulin.all_associated_entries, action.payload]}
      // console.log(insulinNewData)
      // const newEntryData = [...insulin.all_associated_entries, action.payload]
      // const insulinDataCopy = {...insulin, [...insulin.all_associated_entries, action.payload]}
      return {...state, insulins:[...state.insulins, insulinNewData]}

    }

    default:
      return state
  }
}

export {reducer}
